import React, { Component } from "react";

export default class Clock extends Component {
  constructor(props) {
    super(props);
    this.state = { getTime };
  }

  componentDidMount() {
    this.getTime();
  }
  getTime() {
    const currenTime = new Date();
    return {
      hours: currenTime.getHours(),
      minutes: currenTime.getMinutes(),
      seconds: currenTime.getSeconds(),
      ampm: hours >= 12 ? "pm" : "am",
    };
  }

  render() {
    return <div></div>;
  }
}
